import React from 'react';
import '../../../src/components/Events/EventBackGround.css';

const EventsBackGround = () => {

    const ChangeBg = () =>{
        console.log('change bg is working')
    }

    return (
        <>
            <div className="event_main_content">
                <button className="background_button" onClick={ChangeBg} >Change BackGround Color</button>
            </div>
        </>
    );
}

export default EventsBackGround;
